pragma solidity >=0.5.0 <0.6.0;

import "./shopCommentGenerator.sol";

contract CommentGenerator {

	address private owner;

	constructor() public {
		owner = msg.sender;
	}

	event newComment(shopCommentGenerator _newContract);

	function commentContractGenerator(string memory _shopName) public {
		shopCommentGenerator _newContract = new shopCommentGenerator(_shopName);
		emit newComment(_newContract);
	}
}
